import Button from '@material-ui/core/Button';


function Home(){
	return(
		<div>
			<h1>Welcome to NextJs With Materialize Ui</h1>
			 <Button variant="contained" color="primary">
		       MY BUTTON
		    </Button>
		</div>
	);
}

export default Home
